import React from 'react';
import './Content.css';
import Nav from './BandeauHaut';

export default class Content extends React.Component {
    
    render() {
        return(
            
            <div className="kobefond">
            
                <div><Nav/></div>
                <br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br>
                <br></br><br></br>
                <div className="NBAtitre"><b>NBA</b></div>
                <div className="Stattitre"><b>STATISTICS</b></div>
                <div className="Stattitre">Made by React API developped by Mathis PONCET and Jules Ekmekdjian</div>
            </div>
        );
    }
}
